import { Button, DatePicker, Table } from 'antd';
import React from 'react'
import { DataSortTime, GetDateTime, LogDataMappingTime, SetDateRange, TableColumbPDF, TableColumbTimeAsRow } from '../../DataRequest/LogDataRequestWrap';
import { GeneratePDF } from '../../utils/PdfGenerate';


const TimeTableWrapper = (props) => {

    const SetTimeRange = (value) => {
        props.SetTimeRangeCallBack(value)
    }

    const generatePDF = () => {
        let headers = TableColumbPDF()
        GeneratePDF(headers, props.LogValue)
    }

    return (
        <div>
            <DatePicker onChange={SetTimeRange} />
            <Button onClick={generatePDF}> export </Button>
            <Table columns={props.Columb} dataSource={props.LogValue} bordered scroll={{ x: 2000, y: 500 }} pagination={false} size="small" />
        </div>
    )
}

export default TimeTableWrapper
